import React from "react";

function Card({ data }) {
  return (
    <div className="news">
      <h1 className="news__title"><img src={data.md} /></h1>
      <p className="news__desc">{data.title}</p>
      <span className="news__author">{data.author}</span> <br />
      <span className="news__published">{data.published_date}</span>
      <span className="news__source"><a href={data.link} target="_blank">Website Link</a></span>
    </div>
  );
}

export default Card;
